import './App.css';
import Home from './Components/Home';
import Navbar from './Layout/Navbar'
import Trading from './Components/Trading';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Routes

} from "react-router-dom";



function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Home />

        <Routes>


          <Route path="/" component={Home} />



        </Routes>
      </div>
    </Router>
  );
}

export default App;
